import Link from 'next/link';
import User from './wrappers/User';
import SignoutButton from './SignoutButton';

const SideNav = () => (
  <User>
    {({ data, error, loading }) => {
      if (loading) return <p> loading ... </p>;
      let me = data.me;

      return (
        <div>
          {' '}
          <div className="overflow-hidden bg-gray-100 leftbar">
            <h1 className="text-5xl leading-none lowercase">
              <Link href="/">
                <a className="font-bold">Social Meedz</a>
              </Link>
            </h1>
            <Link href="/reporting">
              <a className="nav-link">Example Page</a>
            </Link>
            {me && (
              <>
                <Link href="/permissions">
                  <a className="nav-link">Permissions</a>
                </Link>
                <Link href="/plans">
                  <a className="nav-link">Plans</a>
                </Link>
                <SignoutButton />
              </>
            )}
            {!me && (
              <>
                <Link href="/pricing">
                  <a className="nav-link">Sign Up</a>
                </Link>
                <Link href="/signin">
                  <a className="nav-link">Sign In</a>
                </Link>
              </>
            )}
          </div>
        </div>
      );
    }}
  </User>
);

export default SideNav;
